class name
{
  private $seed;

  public function setSeed($seed)
  {
    $this->seed = crc32($seed);
    mt_srand($this->seed);
  }

  public function getRandomName($array)
  {
    mt_srand(crc32($this->seed.count($array)));
    $i = floor(mt_rand(0, count($array)-1));
    return array($i, $array[$i]);
  }
}

